import React, { useState } from 'react';
const App = () => {
const [num,setNum] = useState();

const Change = () =>{
    setNum(num+1);
}
return(
    <>
    <h1>{num}</h1>
   <button onClick={Change}>Click</button>
   </>
);

}

export default App;
